- uid: 1054
  type: PaperOffice
  components:
  - desc: ""
    name: Setting Up the Reactor Part 1
    type: MetaData
  - pos: -27.233154,9.585441
    parent: 1
    type: Transform
  - content: "I'll just do you this one favor of writing this little guide to setting this up.\n \nFist you place down LV cables on the green marks on the floor. If you've done it right the computer and lights should turn on.\nNext, put down the HV cables over the orange marks on the floor.\nIt should go all the way back to engineering. We put a HV cable in the wall, so it should connect though the wall.\nMove the control rod blocks into the plus sign in the center of the room. Make sure the \"Blocks\" fill the plus sign.\nNext, use the multitool to connect the control rods to the control rod computer.\nMake sure you have ample power output for the rods and equipment in that room.\nNext you add Directional Windows between the airlock and the shutter. Then unspace the room.\n"
    type: Paper
