- uid: 1234
  type: PaperOffice
  components:
  - desc: ""
    name: Setting Up the Reactor Part 2
    type: MetaData
  - pos: -27.261623,9.694816
    parent: 1
    type: Transform
  - content: "Then you buy and place the Radiation Collecters on the yellow Xs, there are 8 yellow Xs.\nThen what you do is get the Rad Suit on, turn on the radiation collecters and \"Scrable\" Control Rod Blocks. It's okay if they move, that's what they do.\nNow print Uranium one at a time and make sure you move them one at a time to the green Radiation Symbol on the floor. Only stack the Uranium ontop of the Green Symbol on the floor.\n \nThere are four symbols on the floor so you can put a stack of five on each symbol, make sure that the rods are down before you do that.\n \nONLY and ONLY when the power output for a stack has gone below 5kW you can add a new uranium pice to a stack. You can check the power output off of the Power Monitoring Computer in that room with all those computers.\n \nP.S. Thanks for the free drinks. I left you a gift as thanks.\n"
    type: Paper
