- uid: 1239
  type: Paper
  components:
  - desc: ""
    type: MetaData
  - pos: -13.135421,1.9281453
    parent: 1
    type: Transform
  - content: "Turn all the pumps, gas filters, and gas mixers. Including the one outside.\n \nThe two filters need to be set to filter oxygen and nitrogen. The filter in the very corner of the room should be set to Nitrogen, the other one needs to be set to Oxygen.\n \nIf you're out of fuel or going to run out of fuel for the generator, you should add HV cable to the blue space power reveiver.\n \nIf you want to warm up the station a bit more, turn off the outside pump for a little bit.\n \nThere is a Nuclear Reactor parts out the north-west airlock, make sure to use it if you want to make more electricity.\n"
    type: Paper
